,'off'),(491,103,'_et_gb_content_width','1080'),(492,103,'footnotes',''),(493,105,'footnotes',''),(503,91,'_et_pb_use_builder','off'),(504,91,'_et_gb_content_width','1080'),(505,91,'footnotes',''),(506,106,'footnotes',''),(507,107,'footnotes',''),(512,95,'_et_pb_use_builder','off'),(513,95,'_et_gb_content_width','1080'),(514,95,'footnotes',''),(515,108,'footnotes',''),(516,109,'footnotes',''),(521,110,'_edit_lock','1771784339:1'),(522,93,'_et_pb_use_builder','off'),(523,93,'_et_gb_content_width','1080'),(524,93,'footnotes',''),(525,111,'footnotes',''),(526,112,'footnotes',''),(529,99,'_et_pb_use_builder','off'),(530,99,'_et_gb_content_width','1080'),(531,99,'footnotes',''),(532,113,'footnotes',''),(533,114,'footnotes',''),(536,101,'_et_pb_use_builder','off'),(537,101,'_et_gb_content_width','1080'),(538,101,'footnotes',''),(539,115,'footnotes',''),(540,116,'footnotes',''),(545,99,'_mpfs_md_db','# Visado de corta duración (turístico, visita a familia, etc.)\r\n\r\nAdvertimos que lo más importante para cumplir los requisitos de este visado y aumentar las probabilidades de aprobación es demostrar que el solicitante tiene motivos suficientes para regresar a Cuba. Nosotros le asesoramos sobre cómo acreditar correctamente este punto. Sin esta justificación, el visado tiene pocas probabilidades de ser concedido. Además, este visado no puede solicitarse con menos de 15 días de antelación a la fecha prevista de viaje ni con más de 6 meses de anticipación.\r\n\r\nSon tres fases del proceso de trámite:\r\n\r\n## Fase 1: Solicitud de credenciales para la Cita\r\n\r\nPara esto se necesita que el solicitante facilite la siguiente información:\r\n- Pasaporte válido por más de 6 meses.\r\n- Seguro de viaje para el período exacto de ida y vuelta. Nosotros facilitamos el preboleto para llevar a la solicitud de SEGURO. Se puede obtener en dos oficinas de la Capital o en España, enviando primero digital.\r\n- Fecha de intención de ida y de regreso. Sin estas fechas no se puede hacer el preboleto, ni el seguro, ni el formulario de solicitud.\r\n\r\n## Fase 2: Gestión de cita\r\n\r\nAl tener las credenciales, coordinamos con el solicitante para fijar la fecha de la cita de solicitud del visado en el Consulado.\r\n\r\n## Fase 3: Preparar expediente de solicitud de visado\r\n\r\nDatos adicionales a ficha de cliente para preparar solicitud de visado:\r\n- Profesión actual.\r\n- Nombre, dirección y teléfono del empleador, si corresponde. En caso de estudiante; nombre y dirección del centro de estudios.\r\n- Especificar motivos del viaje y su estancia en España.\r\n- Fecha prevista de entrada en España.\r\n- Fecha prevista de la salida de España.\r\n- Responder si antes le han tomado huellas para solicitud de visado para Europa y en caso positivo fecha y n.º de visados (ver en pasaportes).\r\n- Si tiene invitación, apellidos, nombres, dirección, teléfono del invitante o del hotel donde se alojará, igualmente todos los datos.\r\n- Si la invitación es de una empresa u organización, todos los datos de localización.\r\n- Aportar datos sobre quien asume los gastos del viaje y con cuales medios de subsistencia (cheques, efectivo, etc.)'),(546,87,'_mpfs_md_db','# Visado de corta duración (turístico, visita a familia, etc.)\r\n\r\nAdvertimos que lo más importante para cumplir los requisitos de este visado y aumentar las probabilidades de aprobación es demostrar que el solicitante tiene motivos suficientes para regresar a Cuba. Nosotros le asesoramos sobre cómo acreditar correctamente este punto. Sin esta justificación, el visado tiene pocas probabilidades de ser concedido. Además, este visado no puede solicitarse con menos de 15 días de antelación a la fecha prevista de viaje ni con más de 6 meses de anticipación.\r\n\r\nSon tres fases del proceso de trámite:\r\n\r\n## Fase 1: Solicitud de credenciales para la Cita\r\n\r\nPara esto se necesita que el solicitante facilite la siguiente información:\r\n- Pasaporte válido por más de 6 meses.\r\n- Seguro de viaje para el período exacto de ida y vuelta. Nosotros facilitamos el preboleto para llevar a la solicitud de SEGURO. Se puede obtener en dos oficinas de la Capital o en España, enviando primero digital.\r\n- Fecha de intención de ida y de regreso. Sin estas fechas no se puede hacer el preboleto, ni el seguro, ni el formulario de solicitud.\r\n\r\n## Fase 2: Gestión de cita\r\n\r\nAl tener las credenciales, coordinamos con el solicitante para fijar la fecha de la cita de solicitud del visado en el Consulado.\r\n\r\n## Fase 3: Preparar expediente de solicitud de visado\r\n\r\nDatos adicionales a ficha de cliente para preparar solicitud de visado:\r\n- Profesión actual.\r\n- Nombre, dirección y teléfono del empleador, si corresponde. En caso de estudiante; nombre y dirección del centro de estudios.\r\n- Especificar motivos del viaje y su estancia en España.\r\n- Fecha prevista de entrada en España.\r\n- Fecha prevista de la salida de España.\r\n- Responder si antes le han tomado huellas para solicitud de visado para Europa y en caso positivo fecha y n.º de visados (ver en pasaportes).\r\n- Si tiene invitación, apellidos, nombres, dirección, teléfono del invitante o del hotel donde se alojará, igualmente todos los datos.\r\n- Si la invitación es de una empresa u organización, todos los datos de localización.\r\n- Aportar datos sobre quien asume los gastos del viaje y con cuales medios de subsistencia (cheques, efectivo, etc.)'),(549,117,'_menu_item_type','post_type'),(550,117,'_menu_item_menu_item_parent','75'),(551,117,'_menu_item_object_id','103'),(552,117,'_menu_item_object','page'),(553,117,'_menu_item_target',''),(554,117,'_menu_item_classes','a:1:{i:0;s:0:\"\";}'),(555,117,'_menu_item_xfn',''),(556,117,'_menu_item_url',''),(558,118,'_menu_item_type','post_type'),(559,118,'_menu_item_menu_item_parent','75'),(560,118,'_menu_item_object_id','101'),(561,118,'_menu_item_object','page'),(562,118,'_menu_item_target',''),(563,118,'_menu_item_classes','a:1:{i:0;s:0:\"\";}'),(564,1