ct_id','87'),(624,125,'_menu_item_object','page'),(625,125,'_menu_item_target',''),(626,125,'_menu_item_classes','a:1:{i:0;s:0:\"\";}'),(627,125,'_menu_item_xfn',''),(628,125,'_menu_item_url',''),(630,75,'_wp_old_date','2026-02-21'),(631,69,'_wp_old_date','2026-02-21'),(634,72,'_wp_old_date','2026-02-21'),(643,97,'_et_pb_use_builder','off'),(644,97,'_et_gb_content_width','1080'),(645,97,'footnotes',''),(646,126,'footnotes',''),(647,97,'_mpfs_md_db','# Registrar el Matrimonio en el Consulado Español\r\n\r\nAclaramos una confusión reinante en muchos clientes y es que NO ES NECESARIO registrar el matrimonio para solicitar visado para el cónyuge no español, basta con tenerlo legalizado por MJUSTICIA para ese trámite. Pero es cierto, en alguna medida tenerlo registrado en el Consulado facilita algunos trámites. El registro en el Consulado del Matrimonio requiere tres fases:\r\n\r\n## Fase 1: Solicitud de credenciales para la Cita\r\n\r\nPara solicitar estas credenciales necesitamos:\r\n- Tomar foto del cónyuge español con su pasaporte español. Lo hacemos aquí nosotros.\r\n- Certificado de Matrimonio Legalizado.\r\n  - No se recomienda con menos de 3 meses de formalizado, salvo que tengan muchas evidencias de ser auténtico, debe decir el certificado el estado civil de ambos cónyuges al momento de contraer ese matrimonio.\r\n- Certificado de nacimiento, legalizado del cónyuge NO ESPAÑOL.\r\n\r\n## Fase 2: Gestionar la cita\r\n\r\nNos encargamos una vez que lleguen las credenciales y confirmemos que los documentos están listos.\r\n\r\n## Fase 3: Preparar el expediente de solicitud de registro\r\n\r\nLos documentos que deben facilitar los cónyuges, además de los anteriores son:\r\n- Si tienen hijos en común: Los certificados de nacimientos, sin importar la edad, no legalizados. Si ya son españoles, igual los certificados de inscripción de nacionalidad española. Y si tienen pasaporte también. Así como los carnés de identidad o tarjeta de menor.\r\n- Si estaban divorciados los cónyuges: Certificado de divorcio anterior de cada uno si procede. Y sentencia de Tribunal de divorcio si procede. Otras situaciones, consultar.\r\n- Si son cónyuges naturales de España deben aportar Fe de Vida y certificado de su estado civil.\r\n- Certificados de los viajes al exterior de Cuba de ambos cónyuges, si han viajado. Legalizado.'),(648,127,'footnotes',''),(651,128,'_edit_lock','1771795640:1'),(652,129,'_edit_lock','1771797697:1'),(653,129,'_edit_last','1'),(654,129,'_mp_map_zoom','16'),(655,130,'_edit_lock','1771798273:1'),(656,130,'_et_pb_use_builder','on'),(657,130,'_et_gb_content_width','1080'),(658,130,'footnotes',''),(659,131,'footnotes',''),(660,130,'_edit_last','1'),(661,130,'_mpfs_render_mode','replace'),(662,130,'_et_pb_post_hide_nav','default'),(663,130,'_et_pb_page_layout','et_no_sidebar'),(664,130,'_et_pb_side_nav','off'),(665,130,'_et_pb_built_for_post_type','page'),(666,132,'footnotes',''),(667,130,'_et_pb_ab_subjects',''),(668,130,'_et_pb_enable_shortcode_tracking',''),(669,130,'_et_pb_ab_current_shortcode','[et_pb_split_track id=\"130\" /]'),(670,130,'_et_pb_custom_css',''),(671,130,'_et_pb_gutter_width','3'),(672,130,'_thumbnail_id','0'),(673,130,'_global_colors_info','{}'),(674,130,'_et_pb_first_image',''),(675,130,'_et_pb_truncate_post',''),(676,130,'_et_pb_truncate_post_date',''),(677,130,'_et_builder_version','VB|Divi|4.27.5'),(678,130,'_et_pb_show_page_creation','off'),(681,133,'footnotes',''),(688,134,'footnotes',''),(694,136,'footnotes',''),(697,137,'footnotes',''),(700,130,'_et_pb_old_content','<!-- wp:shortcode -->\n[mp_map id=\"129\" height=\"350\" zoom=\"16\"]\n<!-- /wp:shortcode -->'),(701,138,'footnotes',''),(702,129,'_mp_map_coords','22.966032,-82.150382'),(703,140,'footnotes',''),(706,141,'footnotes',''),(707,142,'footnotes',''),(708,143,'footnotes',''),(712,145,'footnotes',''),(715,146,'_menu_item_type','post_type'),(716,146,'_menu_item_menu_item_parent','0'),(717,146,'_menu_item_object_id','130'),(718,146,'_menu_item_o