:{}'),(983,172,'_et_dynamic_cached_attributes','a:0:{}'),(984,176,'footnotes',''),(989,89,'_mpfs_md_db','# Solicitud de Nacionalidad Española para HIJOS MENORES DE 20 AÑOS cuyo padre o madre haya obtenido la nacionalidad española\r\n\r\nPueden solicitar la nacionalidad española por opción de los hijos de un progenitor español, con menos de 20 años de edad. Debe distinguirse si nació siendo español su progenitor de los nacidos antes por diferencias en la tramitación.\r\n\r\nNecesitamos disponer de los datos de la ficha de cliente del progenitor español (si es cliente lo tenemos) y también los del hijo si no lo tenemos enviar los datos para dar alta en el SISTEMA DE TRAMITES. Nosotros utilizamos los datos de las fichas de clientes (sale a nombre del progenitor). Los documentos que deben estar listos para la cita son:\r\n- Inscripción de nacimiento del menor, legalizada.\r\n- Inscripción de nacimiento del progenitor NO ESPAÑOL, legalizada\r\n- Inscripción consular digital del progenitor español. Si el progenitor ha sido nuestro cliente la tenemos en los archivos digitales.\r\n- Documentos de identidad de los progenitores y del menor.\r\n\r\nEn este trámite con menores son dos fases solamente:\r\n1. Gestión de la cita del progenitor para el menor. El progenitor debe tener en cuenta que no se puede reservar la cita si los documentos NO ESTÁN LEGALIZADOS, LISTOS.\r\n2. Preparar el expediente para la cita.\r\n\r\nPARA LLENAR EL FORMULARIO DE DATOS PARA EL REGISTRO CIVIL, NECESITAMOS ESTOS DATOS DE LOS PROGENITORES DEL REGISTRADO:\r\n\r\nDEL PADRE:\r\n1.  Estado civil al nacer\r\n2.  Estado civil ahora.\r\n3.  Nacionalidad al nacer\r\n4.  Nacionalidad ahora.\r\n5.  Domicilio actual\r\n6.  Numero del carnet de identidad.\r\n\r\nDE LA MADRE:\r\n1.  Estado civil al nacer\r\n2.  Estado civil ahora.\r\n3.  Nacionalidad al nacer\r\n4.  Nacionalidad ahora.\r\n5.  Domicilio actual\r\n6.  Numero del carnet de identidad.\r\n7.  DEL PROGENITOR (madre o padre) que no está en la cadena de descendencia,\r\nnecesito además: Fecha de nacimiento.'),(990,89,'_et_dynamic_cached_shortcodes','a:0:{}'),(991,89,'_et_dynamic_cached_attributes','a:0:{}'),(992,93,'_et_dynamic_cached_shortcodes','a:0:{}'),(993,93,'_et_dynamic_cached_attributes','a:0:{}'),(994,95,'_et_dynamic_cached_shortcodes','a:0:{}'),(995,95,'_et_dynamic_cached_attributes','a:0:{}'),(996,91,'_et_dynamic_cached_shortcodes','a:0:{}'),(997,91,'_et_dynamic_cached_attributes','a:0:{}'),(998,97,'_et_dynamic_cached_shortcodes','a:0:{}'),(999,97,'_et_dynamic_cached_attributes','a:0:{}'),(1001,179,'footnotes',''),(1002,8,'_et_dynamic_cached_shortcodes','a:18:{i:0;s:18:\"et_pb_column_inner\";i:1;s:33:\"et_pb_social_media_follow_network\";i:2;s:19:\"et_pb_contact_field\";i:3;s:13:\"et_pb_section\";i:4;s:9:\"et_pb_row\";i:5;s:12:\"et_pb_column\";i:6;s:15:\"et_pb_row_inner\";i:7;s:11:\"et_pb_blurb\";i:8;s:12:\"et_pb_button\";i:9;s:18:\"et_pb_contact_form\";i:10;s:9:\"et_pb_cta\";i:11;s:13:\"et_pb_divider\";i:12;s:11:\"et_pb_image\";i:13;s:12:\"et_pb_signup\";i:14;s:25:\"et_pb_social_media_follow\";i:15;s:17:\"et_pb_testimonial\";i:16;s:10:\"et_pb_text\";i:17;s:12:\"et_pb_toggle\";}'),(1003,8,'_et_dynamic_cached_attributes','a:7:{s:17:\"use_custom_gutter\";a:1:{i:0;s:2:\"on\";}s:12:\"gutter_width\";a:1:{i:0;s:1:\"1\";}s:9:\"specialty\";a:1:{i:0;s:2:\"on\";}s:15:\"animation_style\";a:1:{i:0;s:5:\"slide\";}s:11:\"button_icon\";a:1:{i:0;s:17:\"&#x24;||divi||400\";}s:9:\"font_icon\";a:5:{i:0;s:19:\"&#xe052;||divi||400\";i:1;s:17:\"&#xf024;||fa||900\";i:2;s:17:\"&#xf57d;||fa||900\";i:3;s:17:\"&#xf0ac;||fa||900\";i:4;s:17:\"&#xf234;||fa||900\";}s:14:\"social_network\";a:4:{i:0;s:8:\"facebook\";i:1;s:9:\"pinterest\";i:2;s:7:\"twitter\";i:3;s:7:\"youtube\";}}'),(1004,8,'et_enqueued_post_fonts','a:3:{s:6:\"family\";a:1:{s:10:\"et-gf-lato\";s:75:\"Lato:100,100italic,300,300italic,regular,italic,700,700italic,900,900italic\";}s:6:\"subset\";a:2:{i:0;s:5:\"latin\";i:1;s:9:\"latin-ext\";}s:9:\"cache_key\";s:75:\"{\"gp