 citas y acompañamiento en cada etapa del proceso.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué necesito para comenzar?\" open_toggle_background_color=\"#edf0f7\" closed_toggle_background_color=\"#edf0f7\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Solo debe registrarse en nuestro Sistema de Trámites para obtener su Número de Cliente y luego solicitar la gestión deseada.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Puedo gestionar trámites desde fuera de Cuba?\" open_toggle_background_color=\"#edf0f7\" closed_toggle_background_color=\"#edf0f7\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p data-start=\"1779\" data-end=\"1921\">Sí. Nuestros clientes también residen en Estados Unidos, España, Chile y otros países.</p>[/et_pb_toggle][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"About\" _builder_version=\"4.16\" custom_padding=\"80px|0px|80px|0px|true|false\" global_colors_info=\"{}\"][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.16\" use_custom_width=\"on\" locked=\"off\" global_colors_info=\"{}\"][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_text admin_label=\"Text\" _builder_version=\"4.16\" text_font=\"Lato||||||||\" text_font_size=\"18px\" text_line_height=\"1.8em\" link_fon