ocked=\"off\" global_colors_info=\"{}\"][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_text admin_label=\"Text\" _builder_version=\"4.16\" text_font=\"Lato||||||||\" text_font_size=\"18px\" text_line_height=\"1.8em\" link_font=\"||||||||\" ul_font=\"||||||||\" ol_font=\"||||||||\" quote_font=\"||||||||\" header_font=\"||||||||\" header_2_font=\"Lato|700|||||||\" header_2_font_size=\"40px\" header_2_letter_spacing=\"1px\" header_2_line_height=\"1.5em\" header_3_font=\"||||||||\" header_4_font=\"||||||||\" header_5_font=\"||||||||\" header_6_font=\"Lato|700|||||||\" header_6_font_size=\"18px\" header_6_letter_spacing=\"1px\" header_6_line_height=\"1.8em\" text_orientation=\"right\" header_2_font_size_tablet=\"\" header_2_font_size_phone=\"22px\" header_2_font_size_last_edited=\"on|phone\" global_colors_info=\"{}\"]<h2>¿Qué son los Trámites Consulares?<br />¿Para quién están pensados?</h2>\n<p>Los trámites consulares son gestiones oficiales que deben realizarse ante embajadas y consulados extranjeros para obtener documentos, visas, pasaportes, registros, certificaciones o autorizaciones. Muchas de estas gestiones requieren presentar documentos específicos, cumplir requisitos legales, solicitar citas y completar formularios correctamente.<br data-start=\"712\" data-end=\"715\" />Nuestros servicios están dirigidos a personas que necesitan asesoría para realizar estos trámites con seguridad, sin errores y en el menor tiempo posible.</p>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_toggle title=\"¿Quiénes pueden utilizar nuestros servicios?\" open_toggle_background_color=\"#ccd8e5\" closed_toggle_background_color=\"#ccd8e5\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_