f\" button_letter_spacing__hover_enabled=\"on\" button_letter_spacing__hover=\"1px\" button_one_letter_spacing__hover_enabled=\"off\" button_two_letter_spacing__hover_enabled=\"off\" button_bg_color__hover_enabled=\"off\" button_one_bg_color__hover_enabled=\"off\" button_two_bg_color__hover_enabled=\"off\"][/et_pb_button][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"About\" _builder_version=\"4.16\" custom_padding=\"80px|0px|80px|0px|true|false\" global_colors_info=\"{}\"][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.16\" use_custom_width=\"on\" locked=\"off\" global_colors_info=\"{}\"][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_text admin_label=\"Text\" _builder_version=\"4.16\" text_font=\"Lato||||||||\" text_font_size=\"18px\" text_line_height=\"1.8em\" link_font=\"||||||||\" ul_font=\"||||||||\" ol_font=\"||||||||\" quote_font=\"||||||||\" header_font=\"||||||||\" header_2_font=\"Lato|700|||||||\" header_2_font_size=\"40px\" header_2_letter_spacing=\"1px\" header_2_line_height=\"1.5em\" header_3_font=\"||||||||\" header_4_font=\"||||||||\" header_5_font=\"||||||||\" header_6_font=\"Lato|700|||||||\" header_6_font_size=\"18px\" header_6_letter_spacing=\"1px\" header_6_line_height=\"1.8em\" text_orientation=\"right\" header_2_font_size_tablet=\"\" header_2_font_size_phone=\"22px\" header_2_font_size_last_edited=\"on|phone\" global_colors_info=\"{}\"]<h2>¿Qué son los Trámites Consulares?<br />¿Para quién están pensados?</h2>\n<p>Los trámites consulares son gestiones oficiales que deben realizarse ante embajadas y consulados extranjeros para obtener documentos, visas, pasaportes, registros, certificaciones o autorizaciones. Muchas de estas gestiones requieren presentar documentos específicos, cumplir requisitos legales, solicitar citas y completar formularios correctamente.<br data-start=\"712\" data-end=\"715\" />Nuestros servicios están dirigidos a personas que necesitan asesoría para realizar estos trámites con seguridad, sin errores y en el menor tiempo posible.</p>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_toggle title=\"¿Quiénes pueden utilizar nuestros servicios?\" open_toggle_background_color=\"#ccd8e5\" closed_toggle_background_color=\"#ccd8e5\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Personas residentes en Cuba o en el extranjero que necesiten realizar trámites ante consulados de España, Estados Unidos, Canadá, México y otros países.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué trámites gestionamos?\" open_toggle_background_color=\"#dae1ed\" closed_toggle_background_color=\"#dae1ed\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Nacionalidad Española, Certificados, Visados, Pasaporte, Legalizaciones, Parole Humanitario, Lotería de Visas (DV), Citas Consulares y más.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué beneficios tiene hacerlo con apoyo profesional?\" open_toggle_background_color=\"#e3e9ef\" closed_toggle_background_color=\"#e3e9ef\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Reducción de errores, orientación documentaria, preparación previa, gestión de citas y acompañamiento en cada etapa del proceso.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué necesito para comenzar?\" open_toggle_background_color=\"#edf0f7\" closed_toggle_background_color=\"#edf0f7\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Solo debe registrarse en nuestro Sistema de Trámites para obtener su Número de Cliente y luego solicitar la gestión deseada.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Puedo gestionar trámites desde fuera de Cuba?\" open_toggle_background_color=\"#edf0f7\" closed_toggle_background_color=\"#edf0f7\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p data-start=\"1779\" data-end=\"1921\">Sí. Nuestros clientes también residen en Estados Unidos, España, Chile y otros países.</p>[/et_pb_toggle][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"About\" _builder_version=\"4.16\" custom_padding=\"80px|0px|80px|0px|true|false\" global_colors_info=\"{}\"][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"4.16\" use_custom_width=\"on\" locked=\"off\" global_