gle_background_color=\"#dae1ed\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Nacionalidad Española, Certificados, Visados, Pasaporte, Legalizaciones, Parole Humanitario, Lotería de Visas (DV), Citas Consulares y más.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué beneficios tiene hacerlo con apoyo profesional?\" open_toggle_background_color=\"#e3e9ef\" closed_toggle_background_color=\"#e3e9ef\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Reducción de errores, orientación documentaria, preparación previa, gestión de citas y acompañamiento en cada etapa del proceso.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué necesito para comenzar?\" open_toggle_background_color=\"#edf0f7\" closed_toggle_background_color=\"#edf0f7\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Solo debe registrarse en nuestro Sistema de Trámites para obtener su Número de Cliente y luego solicitar la gestión deseada.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Puedo gestionar trámites desde fuera de Cuba?\" open_toggle_background_color=\"#edf0f7\" closed_toggle_background_color=\"#edf0f7\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p data-start=\"1779\" data-end=\"1921\">Sí. Nuestros clientes también residen en Estados Unidos, España, Chile y otros países.</p>[/et_pb_toggle][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" custom_padding_last_edited=\"on|phone\" prev_background_color=\"#ffffff\" admin_label=\"Blank Section - Image Background\" _builder_version=\"4.27.5\" background_image=\"https://www.tramitesdiosdado.com/wp-content/uploads/2026/01/diosdado-recostado-pared.png\" background_position=\"top_center\" custom_padding=\"16.3%||16.3%||true|false\" custom_padding_tablet=\"260px||260px||true\" custom_padding_phone=\"100px|||\" top_divider_style=\"slant\" top_divider_flip=\"horizontal\" bottom_divider_style=\"slant\" bottom_divider_color=\"#f5f5f5\" bottom_divider_flip=\"horizontal\" global_colors_info=\"{}\"][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"About\" _builder_version=\"4.16\" background_color=\"#f5f5f5\" custom_margin=\"|||\" custom_padding=\"0px||0px||false|\" global_colors_info=\"{}\"][et_pb_row column_structure=\"1_2,1_2\" use_custom_gutter=\"on\" gutter_width=\"1\" _builder_version=\"4.27.5\" custom_margin=\"|||\" custom_padding=\"0px||0px||true\" global_colors_info=\"{}\"][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_cta title=\"Acerca de mí\" button_url=\"#\" button_text=\"Conocer más sobre mi trabajo\" admin_label=\"About Me\" _builder_version=\"4.27.5\" header_font=\"Lato|700|||||||\" header_font_size=\"30px\" header