¿Para quién están pensados?</h2>\n<p>Los trámites consulares son gestiones oficiales que deben realizarse ante embajadas y consulados extranjeros para obtener documentos, visas, pasaportes, registros, certificaciones o autorizaciones. Muchas de estas gestiones requieren presentar documentos específicos, cumplir requisitos legales, solicitar citas y completar formularios correctamente.<br data-start=\"712\" data-end=\"715\" />Nuestros servicios están dirigidos a personas que necesitan asesoría para realizar estos trámites con seguridad, sin errores y en el menor tiempo posible.</p>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"4.16\" custom_padding=\"|||\" global_colors_info=\"{}\" custom_padding__hover=\"|||\"][et_pb_toggle title=\"¿Quiénes pueden utilizar nuestros servicios?\" open_toggle_background_color=\"#ccd8e5\" closed_toggle_background_color=\"#ccd8e5\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Personas residentes en Cuba o en el extranjero que necesiten realizar trámites ante consulados de España, Estados Unidos, Canadá, México y otros países.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué trámites gestionamos?\" open_toggle_background_color=\"#dae1ed\" closed_toggle_background_color=\"#dae1ed\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Nacionalidad Española, Certificados, Visados, Pasaporte, Legalizaciones, Parole Humanitario, Lotería de Visas (DV), Citas Consulares y más.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué beneficios tiene hacerlo con apoyo profesional?\" open_toggle_background_color=\"#e3e9ef\" closed_toggle_background_color=\"#e3e9ef\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Reducción de errores, orientación documentaria, preparación previa, gestión de citas y acompañamiento en cada etapa del proceso.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Qué necesito para comenzar?\" open_toggle_background_color=\"#edf0f7\" closed_toggle_background_color=\"#edf0f7\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p>Solo debe registrarse en nuestro Sistema de Trámites para obtener su Número de Cliente y luego solicitar la gestión deseada.</p>[/et_pb_toggle][et_pb_toggle title=\"¿Puedo gestionar trámites desde fuera de Cuba?\" open_toggle_background_color=\"#edf0f7\" closed_toggle_background_color=\"#edf0f7\" icon_color=\"#345168\" open_icon_color=\"#345168\" _builder_version=\"4.16\" title_font=\"Lato|700|||||||\" title_line_height=\"1.5em\" body_font=\"||||||||\" body_font_size=\"16px\" body_line_height=\"2em\" custom_margin=\"||0px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"10%\" border_width_all=\"0px\" global_colors_info=\"{}\"]<p data-start=\"1779\